Quotes from amazon.com

&quot;Jimmy Rosenberg is one of the very best contemporary gypsy jazz guitarists &amp; this is one of his very best CDs... if you love Django-style guitar &amp; real guitar chops- this CD is essential!&quot;

&quot;He is just up there with the likes of Al diMeola, Paco de Lucia, John McLaughlin and others&quot;

&quot;Jimmy and his compatriots take you for a roller coaster ride right from the start. Killer jazz lines easy to understand and feel. I'm incredibly inspired to play after hearing just one tune. If you're a gipsy/bebop Jazz guitar lover you gotta get this CD right away (and you can't get it at your local music store either :)&quot;

Personally I don't feel inspired to play the guitar myself at all after hearing this record. I just sit there in total awe and wouldn't dare to pick up my guitar :) 

